import React from 'react';

const ProfessionalSummary = () => {
    return (
        <section id="professional-summary">
            <h2>Professional Summary</h2>
            <p>Passionate Java Developer with 4 years of experience in building, debugging, and testing robust Java applications. Seeking to leverage my expertise in Spring Boot, microservices architecture, and RESTful API development to design and implement next-generation business applications in a dynamic and remote work environment.</p>
        </section>
    );
};

export default ProfessionalSummary;
